window.bookSummaryJSON = "<p><b>With all the small matters handled, only the big ones remained.</b></p> <p>With Ciege back in the land of the living, and with Lola settled into her new position in Arda, Sylver was left to deal with his greatest foe yet.</p> <p>A <b><i>[Hero]</i></b>.</p> <p>And the demons, cultists, and other nonsense that the <b><i>[Hero]</i></b> brought along with him.</p> <p>Join Sylver as he embarks on the adventure of the unlifetime to shoo away the insane god empowered child that threatened to wreck everything Sylver had so painstakingly built up over the year.</p> <p>With the woman in white’s visit mere months away, Sylver would have to act fast, act hard, and he would need all the strength and corpses he could get.</p> <p><b>Book 2 of this Fantasy LitRPG Series about a reincarnated necromancer growing in power and finding his way in a new world where the rules have changed vastly since he last \"lived.\" </b></p> <p><b>About the series: </b>With equal parts humor and dark sorcery action, expect loads of skill progression, deep worldbuilding, and unforgettable characters in this story which had nearly 10 million views on Royal Road. Now completely revised and re-edited for Kindle &amp; Audible.</p>"; 
